Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = spark.read()
      .textFile("onsite_data.txt")
      .javaRDD()

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.read()
      .textFile("top_queries.txt")
      .javaRDD()

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache: Map[String, (Long, Boolean)] = mutable.Map()

    // Process onsite data
    val hitRate = onsiteData.map(new Function[String, (String, Boolean)] {
      override def call(line: String): (String, Boolean) = {
        val Array(query, timestamp) = line.split(" ")
        if (broadcastTopQueries.value.contains(query)) {
          val cacheEntry = cache.getOrElseUpdate(query, (timestamp.toLong, false))
          val (lastTimestamp, isHit) = cacheEntry
          val isNewHit = timestamp.toLong - lastTimestamp <= 12 * 60 * 60 * 1000
          if (!isHit && isNewHit) {
            cache.put(query, (timestamp.toLong, true))
            (query, false)
          } else {
            (query, true)
          }
        } else {
          (query, false)
        }
      }
    }).filter(_._2).count().toDouble / onsiteData.count()

    println(s"Hit rate: $hitRate")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from text files. It then broadcasts the top frequent queries to all nodes in the cluster.

The job initializes a cache to store the last timestamp and hit status for each query. It then processes each line in the onsite attributed data and checks if the query is in the top frequent queries. If it is, the job checks if the query is already in the cache and if it's a new hit. If it's a new hit, the job updates the cache and marks it as a miss. Otherwise, it marks it as a hit.

Finally, the job calculates the hit rate by dividing the number of hits by the total number of queries in the onsite attributed data.

